<?php

class filemanager extends application {

    const application_name = 'File Manager';
    const author = 'aramok';
    const version = '1.2';
    const info = "This if file manager that allows u to see whats inside folders :D";
    const width = 640;
    const height = 380;

    public $UI;
    public $filereader;

    function __construct($app_file_name, $window_id, $file) {
        $this->layout_type = 'layout_white';
        $this->window_width = self::width;
        $this->window_height = self::height;
        $this->path = dirname(__FILE__);
        $this->name = self::application_name;
        $this->icon = $app_file_name . '.png';
        $this->window_id = $window_id;
        $this->resize = parent::RESIZE_FULL;

        //$projectdir = $_SERVER["DOCUMENT_ROOT"] . '/aramoknet/index.php';
        //filemanager-absolutepath == projectdir oluyor
        $this->UI = new UI_manager();
        $this->filereader = new FIO();
        $this->file = $file;
    }

    function draw_application_content() {
        global $theme;
        $icons = $this->filereader->list_dir($this->file);
        ?>
        <div class="file-manager-content iconview-horizontal">
            <?= $this->UI->draw_icons($icons,$theme, 0, $this->window_id) ?>
        </div>
        <?php
    }

    public function application_css() {
        ?>
        <style>
            div.fmleft{
                display:inline-block;
            }


            div.fmright{
                display:inline-block;
            }
        </style>

        <?php
    }

    public function application_javascript() {
        ?>
        <script>
            $(document).ready(function () {
                features_init();
                ///burayada bisiler gelcek acilinda yukardaki zimbirti   
            });

            function uplevel_dir(event, window_id) {
                var path = $('#window' + window_id + ' .inpdirpath').val();
                var uplevel = path.substring(0, path.lastIndexOf("/"));
                var username = readCookie_depleted('username');
                if (username === null) {
                    var level = ((path + '/').replace('<?= ABSPATH ?>', '')).split('/').length;
                    if (level === 1) {
                        open_window(event, 'dialog', 'apps/system/dialog', 4);
                        return 0;
                    }
                } else {
                    //giris yapilmissa izin ver her yere
                }

                refresh_window(event, uplevel, window_id);
            }

            function refresh_window(event, dir, window_id) {
                var dataObject = {};
                dataObject['directory'] = dir;
                dataObject['window_id'] = window_id;
                $.ajax({
                    url: 'apps/filemanager/navigate.php',
                    type: 'post',
                    data: dataObject,
                    xhr: function () {
                        var xhr = new window.XMLHttpRequest();

                        // Upload progress
                        xhr.upload.addEventListener("progress", function (evt) {
                            if (evt.lengthComputable) {
                                var percentComplete = evt.loaded / evt.total;
                                //Do something with upload progress
                                //console.log(percentComplete);
                                $("html").css('cursor', 'wait');
                                $(".loading").show();
                            }
                        }, false);

                        // Download progress
                        xhr.addEventListener("progress", function (evt) {
                            if (evt.lengthComputable) {
                                var percentComplete = evt.loaded / evt.total;
                                // Do something with download progress
                                //console.log(percentComplete);
                                $("html").css('cursor', 'wait');
                                $(".loading").show();
                            }
                        }, false);


                        //Done progress
                        xhr.addEventListener("load", function (evt) {
                            $("html").css('cursor', 'auto');
                            $(".loading").hide();
                        }, false);


                        return xhr;
                    },
                    /*xhrFields: {
                     onprogress: function (e) {
                     if (e.lengthComputable) {
                     var pct = (e.loaded / e.total) * 100;
                     $("html").css('cursor', 'wait');
                     $(".loading").show();
                     //$(".loading .progress").css('width', pct + '%');
                     }
                     }
                     },*/
                    success: function (data, status) {
                        //$("html").css('cursor', 'auto');
                        //$(".loading").hide();
                        $('#window' + window_id + ' .file-manager-content').html(data);
                        $('#window' + window_id + ' .inpdirpath').val(dir);
                        var dirs;
                        var username = readCookie_depleted('username');

                        if (username === null) {
                            dirs = ((dir + '/').replace('<?= ABSPATH ?>', 'Root/')).split('/');
                        } else {
                            dirs = dir.split("/");
                        }


                        $('#window' + window_id + ' .dirpath .dirn_holder').html('');
                        dirs.forEach(function (dir) {
                            if (dir.length > 0) {
                                $('#window' + window_id + ' .dirpath .dirn_holder').append('<a href="#" class="dirp">' + dir + '</a><img src="data:image/png;base64,">');
                            }
                        });
                    },
                    error: function (xhr, desc, err) {
                        alert("Details: " + desc + "\nError:" + err + "--" + xhr);

                    }
                }); // end ajax call
            }
        </script>
        <?php
    }

    public function draw_application_toolbar() {
        $username = filter_input(INPUT_COOKIE, "username", FILTER_DEFAULT);
        $up_action = 'uplevel_dir(event,' . $this->window_id . ')';
        $imagedir = str_replace($_SERVER["DOCUMENT_ROOT"], '', dirname(__FILE__));

        $sep = 'data:image/png;base64,';
        ?>

        <div class="fmleft actionbuttons" >
            <a href="#" onclick="<?= $up_action ?>">
                <img src="<?= $imagedir ?>/folder_up.png"> Up
            </a>
            <?php
            if (isset($username)) {
                ?>
                <a href="#" onclick="<?= $up_action ?>">
                    <img src="<?= $imagedir ?>/upload.png"> Upload
                </a>
                <a href="#" onclick="<?= $up_action ?>">
                    <img src="<?= $imagedir ?>/newfile.png"> Create
                </a>
                <?php
            }
            ?>
        </div>

        <div class="dirpath">
            <input class="inpdirpath" type="hidden" value="<?= (isset($this->file)) ? $this->file : "/" ?>">
            <div class="dirn_holder" style="overflow-x: auto;">
                <?php
                $dirn = (isset($this->file)) ? $this->file : "/";

                if (isset($username)) {
                    $dirs = explode('/', $dirn);
                } else {
                    $dirs = explode('/', str_replace(ABSPATH, 'Root/', $dirn));
                }


                foreach ($dirs as $dir) {
                    if (strlen($dir) > 0) {
                        echo '<a href="#" class="dirp">' . $dir . '</a><img src="' . $sep . '">';
                    }
                }
                ?>
            </div>
        </div>

        <?php
    }

}
